import { combineReducers } from "redux";

const getRandomName = () => {
  return "bob";
};

const contactReducer = (
  state = { name: getRandomName(), room: 12 },
  action
) => {
  // Do somethin
  switch (action.type) {
    case "SET_INFO":
      return action.payload;
    default:
      return state;
  }
};

export default combineReducers({
  contactReducer
});
